			["customText"] = "function()\n    local playerRole = UnitGroupRolesAssigned(\"player\")\n    \n    local raidInfo = {\n        {},\n        {},\n        {}\n    }\n    \n    for i = 1, GetNumGroupMembers() do\n        \n        local unit = \"raid\"..i\n        local role = UnitGroupRolesAssigned(unit) \n        \n        if aura_env.showAllRoles or role == playerRole then\n            local corr = UnitPower(unit, SPELL_POWER_ALTERNATE_POWER)\n            local name = string.format(\"|c%s%s|r\", RAID_CLASS_COLORS[select(2, UnitClass(unit))].colorStr, UnitName(unit))\n            \n            local info = {}\n            info.name = name\n            info.corr = corr\n            table.insert(raidInfo[aura_env.roles[role]], info)\n        end\n        \n    end\n    \n    local result = \"\"\n    \n    for i = 1, 3 do\n        \n        table.sort(raidInfo[i], function(a,b) return a.corr<b.corr end)\n        \n        if aura_env.showAllRoles or playerRole == aura_env.roles[i] then\n            \n            result = result..aura_env.roles[i]..\":\\n\"\n            for j = 1, #raidInfo[i] do\n                \n                result = string.format(\"%s%3d %s\\n\", result, raidInfo[i][j].corr, raidInfo[i][j].name)\n                \n            end\n            result = result..\"\\n\"\n            \n        end\n        \n    end\n    \n    return result\n    \nend",
