					["x"] = 0,
					["colorFunc"] = "return function(progress, r1, g1, b1, a1, r2, g2, b2, a2)\n    if not aura_env.state then return 0, 0, 0, 0 end -- ERROR\n    local color = aura_env.COLORS[aura_env.state.name]\n    return color[1], color[2], color[3], 1\nend",
					["rotate"] = 0,
