				["custom"] = "function(allstates, event)\n    local cTime = GetTime()\n    aura_env.nextClearTime = aura_env.nextClearTime or (cTime + aura_env.clearInterval)\n    aura_env.damageTracker = aura_env.damageTracker or {}\n    \n    -- Remove data too old to be useful\n    \n    function clearData ()\n        if cTime >= aura_env.nextClearTime then\n            local tempTable = {}\n            \n            for _, v in ipairs(aura_env.damageTracker) do\n                if v[1] >= cTime - aura_env.dataInterval then\n                    table.insert(tempTable, v)\n                end\n            end\n            \n            aura_env.damageTracker = tempTable\n            aura_env.nextClearTime = cTime + aura_env.clearInterval\n        end\n    end\n    \n    -- Calculate the total damage by type\n    function calculateTotals ()\n        local damageTotals = {}\n        local total = 0\n        \n        for _, v in ipairs(aura_env.damageTracker) do\n            local dmgTime, dmgType, dmgAmount = v[1], v[2], v[3]\n            if dmgTime >= cTime - aura_env.dataInterval then\n                damageTotals[dmgType] = (damageTotals[dmgType] or 0) + dmgAmount\n                total = total + dmgAmount\n            end\n        end\n        \n        if total > 0 then\n            damageTotals[\"Total\"] = total\n        end\n        \n        return damageTotals\n    end\n    \n    function isDisplayableType(type)\n        -- If the filter list is a whitelist then only types in the filter are displayable, else only types not in the filter are\n        local inFilter = aura_env.displayFilter[type] ~= nil\n        return aura_env.isDisplayWhitelist == inFilter\n    end\n    \n    -- Create or update any bars\n    function manageBars (damageTotals)\n        for _, v in pairs(allstates) do\n            v.show = false\n            v.changed = true\n        end\n        \n        local totalDamage = damageTotals[\"Total\"]\n        if not totalDamage or totalDamage <= 0 then\n            return false -- Error checking\n        end\n        \n        for type, amount in pairs(damageTotals) do\n            if isDisplayableType(type) then\n                allstates[type] = allstates[type] or {}\n                local state = allstates[type]\n                state.show = true\n                state.changed = true\n                state.name = type\n                state.progressType = \"static\"\n                state.value = amount\n                state.total = totalDamage\n                \n                -- Trigger a resort\n                state.resort = true\n                state.expirationTime = amount\n                -- Add some to make sure the Total bar is always on top\n                if type == \"total\" then\n                    state.expirationTime = totalDamage + 1000\n                end\n            end\n        end\n    end\n    \n    clearData()\n    local damageTotals = calculateTotals()\n    manageBars(damageTotals)\n    \n    return true\nend",
