			["borderSize"] = 1,
			["width"] = 215,
			["icon_side"] = "RIGHT",
			["actions"] = {
				["start"] = {
				},
				["init"] = {
					["do_custom"] = true,
					["custom"] = "--------------------\n-- CONFIG OPTIONS --\n--------------------\n\n-- Controls how damage is grouped\n--    false: by school, i.e. Physical, Fire, Chaos, etc.\n--    true : by category, Physical, Magical, or Hybrid\naura_env.simpleTypes = true\n\n-- Controls how many seconds of damage is displayed\naura_env.dataInterval = 20\n\n-- Type display filtering\n-- These variables are used to filter the damage types displayed\n-- If isDisplayWhitelist,\n--   then: only types in displayFilter are displayed\n--   else: types in displayFilter are hidden\n-- Non-displayed types still contribute to the Total damage value\n--\n-- Examples:\n--   Only display Magical damage bar:\n--      aura_env.isDisplayWhitelist = true\n--      aura_env.displayFilter = {Magical = true}\n--   Only display Physical and Magical damage bars:\n--      aura_env.isDisplayWhitelist = true\n--      aura_env.displayFilter = {Physical = true, Magical = true}\n--   Show everything except Total damage bar:\n--      aura_env.isDisplayWhitelist = false\n--      aura_env.displayFilter = {Total = true}\naura_env.isDisplayWhitelist = false\naura_env.displayFilter = {Total = true}\n\n-- Type tracking filtering\n-- These variables are used to filter the damage types tracked.\n-- Usage is the same as with display filtering except untracked types do not contribute to the Total damage value\naura_env.isTrackingWhitelist = false\naura_env.trackingFilter = {}\n\n\n------------------------\n-- END CONFIG OPTIONS --\n------------------------\n\n-- CLEAR FREQUENCY VARS\naura_env.clearInterval = aura_env.dataInterval * 2\naura_env.nextClearTime = GetTime()\n\naura_env.damageTracker = {}\n\n-- BUILD MAP OF COLORS\n\naura_env.COLORS = {}\naura_env.COLORS[\"Total\"] = {0, 0, 1} -- TOTAL : BLUE\n\nlocal BASE_COLORS = {}\nBASE_COLORS[1]  = { 1    , 1    , 1     } -- PHYSICAL : WHITE\nBASE_COLORS[2]  = { 1    , 1    , 0.627 } -- HOLY : PALE YELLOW\nBASE_COLORS[4]  = { 1    , 0.5  , 0.5   } -- FIRE : PALE RED\nBASE_COLORS[8]  = { 0.5  , 1    , 0.5   } -- NATURE : PALE GREEN\nBASE_COLORS[16] = { 0.5  , 0.5  , 1     } -- FROST : PALE BLUE\nBASE_COLORS[32] = { 0.628, 0    , 0.628 } -- SHADOW : PURPLE\nBASE_COLORS[64] = { 1    , 0.725, 1     } -- ARCANE : PINK\n\nfunction addColor(colorId)\n    function hasBit(x, bit)\n        return x % (2 * bit) >= bit\n    end\n    \n    local colorSchool = GetSchoolString(colorId)\n    if aura_env.COLORS[colorSchool] then return end\n    local count, r, g, b = 0, 0, 0, 0\n    \n    local cm = 1\n    while cm <= 64 do\n        if hasBit(colorId, cm) then\n            count = count + 1\n            local cmColor = BASE_COLORS[cm]\n            r = r + cmColor[1]\n            g = g + cmColor[2]\n            b = b + cmColor[3]\n        end\n        cm = cm * 2\n    end\n    \n    if count == 0 then return end\n    aura_env.COLORS[colorSchool] = {r / count, g / count, b / count}\nend\n\nlocal i = 1\nwhile i <= 64 do\n    local j = 1\n    while j <= 64 do\n        local newColor = (i == j) and i or (i + j)\n        addColor(newColor)\n        j = j * 2\n    end\n    i = i * 2\nend\n\naddColor(28)\naddColor(124)\naddColor(126)\naddColor(127)\n\naura_env.COLORS[\"Magical\"] = aura_env.COLORS[\"Shadow\"]\naura_env.COLORS[\"Hybrid\"] = aura_env.COLORS[\"Arcane\"]\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
				},
				["finish"] = {
