			},
			["borderBackdrop"] = "Blizzard Dialog Background",
			["sparkHeight"] = 30,
			["additional_triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["custom_type"] = "event",
						["event"] = "Chat Message",
						["subeventPrefix"] = "SPELL",
						["events"] = "COMBAT_LOG_EVENT_UNFILTERED",
						["subeventSuffix"] = "_CAST_START",
						["unevent"] = "auto",
						["custom"] = "function(e, timestamp, subEvent, ...)\n    function getDmgTypeString(schoolId)\n        if not aura_env.simpleTypes then\n            return GetSchoolString(schoolId)\n        end\n        \n        if schoolId == 1 then\n            return \"Physical\"\n        elseif schoolId % 2 >= 1 then\n            return \"Hybrid\"\n        else\n            return \"Magical\"\n        end\n    end\n    \n    function isTrackableType(type)\n        -- If the filter list is a whitelist then only types in the filter are trackable, else only types not in the filter are\n        local inFilter = aura_env.trackingFilter[type] ~= nil\n        return aura_env.isTrackingWhitelist == inFilter\n    end\n    \n    -- Ignore if target != player, it isn't damage, or it's environmental\n    if select(6, ...) ~= UnitGUID(\"player\") or not subEvent:find(\"_DAMAGE\") or subEvent:find(\"ENVIRONMENTAL\") then\n        return false\n    end\n    \n    -- Get or create the damage tracker\n    aura_env.damageTracker = aura_env.damageTracker or {}\n    \n    local amountIndex = 10\n    \n    -- Damage amount index differs based on damage type\n    if subEvent:find(\"SPELL_\") or subEvent:find(\"RANGE_\") then\n        amountIndex = amountIndex + 3\n    end\n    \n    local dmgTime = GetTime()\n    local dmgType = getDmgTypeString(select(12, ...))\n    local dmgAmount = select(amountIndex, ...)\n    \n    if isTrackableType(dmgType) then\n        table.insert(aura_env.damageTracker, {dmgTime, dmgType, dmgAmount})\n    end\n    \n    return false\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
