			["customTextUpdate"] = "update",
			["url"] = "https://wago.io/NkogH0_D-",
			["actions"] = {
				["start"] = {
					["custom"] = "\n\n",
					["do_custom"] = false,
				},
				["init"] = {
					["custom"] = "--settings start\n\naura_env.showAbsolute = true --set to true to show absolute heal value instead of percentage\naura_env.numDecimals = 1 --number of decimals to show for percentage based display (can also be 0)\naura_env.printHealToChat = false --print the predicted amount to the chat each time FR is used\naura_env.printSummary = false --print a short summary after boss encounters\n\n--if you want the text to be colored should certain percentages be reached, then you can insert or remove the entries in this table.\n--the entries have to be sorted by increasing percentages for this to work correctly.\n--this is independent of using aura_env.showAbsolute, meaning you can show the absolute value being healed, but the coloring is always based on percentages.\naura_env.colors = {\n    {0.0, \"ffffffff\"},\n    {0.3, \"FFBFF00\"},\n    {0.5, \"FFF0000\"},\n}\n\n--settings end\n\n\n\n--DON'T TOUCH THIS!\naura_env.dmgTaken = {} --table to store damage taken\naura_env.lastSec = 5 --how long damage events are taken into account\naura_env.percDmg = 0.5 --percentage of the damage that is being healed\naura_env.minHealthPerc = 0.05 --minimum percentage that is being\n\naura_env.healing = nil --holds the value currently being predicted (always absolute)\naura_env.display = nil --holds the value currently being displayed (either absolute or percentage)\n\naura_env.stats = {} --table for stat tracking\naura_env.stats.active = false --is the stat tracking currently active\naura_env.stats.timesUsed = 0 --times that FR was used\naura_env.stats.predicted = 0 --total predicted amount of healing\naura_env.stats.healing = 0 --currently unused\naura_env.stats.overheal = 0 --currently unused\n\n--table to exclude certain abilities that deal damage but do not increase the healing done by FR\naura_env.exclude = {\n    [223414] = true, --Parasitic Fetter\n    [204611] = true, --Crushing Grip\n    [204658] = true, --Crushing Grip\n}\n\n--number shortening function\naura_env.shortenNumber = function(number)\n    if type(number) ~= \"number\" then\n        number = tonumber(number)\n    end\n    if not number then\n        return\n    end\n    \n    local affixes = {\n        \"\",\n        \"k\",\n        \"m\",\n        \"b\",\n    }\n    \n    local affix = 1\n    local dec = 0\n    local num1 = math.abs(number)\n    while num1 >= 1000 and affix < #affixes do\n        num1 = num1 / 1000\n        affix = affix + 1\n    end\n    if affix > 1 then\n        dec = 2\n        local num2 = num1\n        while num2 >= 10 do\n            num2 = num2 / 10\n            dec = dec - 1\n        end\n    end\n    if number < 0 then\n        num1 = -num1\n    end\n    \n    return string.format(\"%.\"..dec..\"f\"..affixes[affix], num1)\nend\n\n--set bonuses\naura_env.GetNumSetPieces = function(set, class)\n    class = class or select(2, UnitClass(\"player\"))\n    local pieces = aura_env.sets[class][set] or {}\n    local counter = 0\n    for _, itemID in ipairs(pieces) do\n        if IsEquippedItem(itemID) then\n            counter = counter + 1\n        end\n    end\n    return counter\nend\n\naura_env.sets = {\n    [\"DRUID\"] = {\n        [\"T18\"] = {\n            124246,\n            124255,\n            124261,\n            124267,\n            124272,\n        },\n    },\n}",
